import React, { Component } from 'react';
import { connect } from 'react-redux';
import * as actions from '../../actions/general.act';
import Product from './product/Product';

class MyStore extends Component {
    constructor(props) {
        super(props)
        this.state = {}
    }

    componentWillMount() {
        this.props.getProductsList();
    }

    render() {
        console.log(this.props.general.products)
        let { products } = this.props.general;

        return (
            <div className="myStore">
                {products.map((item, key) => <Product {...this.props} key={key} product={item} />)}
            </div>
        );
    }
}

const mapStateToProps = state => ({
    ...state
})

export default connect(mapStateToProps, actions)(MyStore);
